import React, { Component } from "react";
import axios from "axios";

class WeekDisplay extends Component {
  constructor(props) {
    super(props);

    this.state = {
      study_periods: [],
      exam_periods: [],
      reexam_periods: []
    };
    console.log(this.state);
  }

  componentDidMount() {
    axios
      .get("http://localhost:5000/getDataJson")
      .then(res => {
        this.setState({
          study_periods: res.data.study_periods,
          exam_periods: res.data.exam_periods,
          reexam_periods: res.data.reexam_periods
        });
      })
      .catch(err => {
        console.log(err);
      });
  }

  getText = () => {
    return this.state.study_periods[0];
  };

  render() {
    return (
      <div className="WeekDisplay">
        <p className="WeekDisplayText"> {this.getText()}</p>
      </div>
    );
  }
}

export default WeekDisplay;
